column17:
The following post uses a Distract tactic by discussing an irrelevant topic (energy) instead of the main topic (Armenian-Azerbaijani conflict):
@vonderleyen So close to Ukraine : great. And so close to Azerbaijan belonging to Aliyev : reprehensible. This regime wants to erase Armenia and Artsakh. This means killing these people. Instead of acting to protect them you settle gas deals with the dictator : criminal #StopArtsakhBlockade

This post distracts from the main topic by bringing up gas deals with Azerbaijan, which is not directly related to the conflict in Artsakh. This tactic is used to shift the focus away from the conflict and instead criticize the European Union for their dealings with Azerbaijan.
